import React from 'react';
import {useSelector} from "react-redux";

const HomePage = () => {

    const {testCategories} = useSelector(state => state.memoryReducer)

    return (
        <div className='home-page'>
            {testCategories.map(category =>
                <div key={category.id}>
                    {category.name}
                </div>
            )}
        </div>
    );
};

export default HomePage;
